import "./HomePart3Style.css"

export default function HomePart3(){
    const a =require("../../../assets/Home/paper.png")
    return (
        <>
            <div id="homepart3">
                <div className="left">
                    <div className="text1">Who are we and what we do</div>
                    <div className="text2">We are an undergraduate student team from Zhejiang University and we can help you test the robustness of your AI model. Our testing methods cover traditional AI attack methods as well as our self-developed new type of bounce attack method.</div>
                </div>
                <div className="right">
                    <img src={a}  alt="pic"></img>
                </div>
            </div>
        </>
    );
}
